import React, { lazy, Suspense } from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import {
  ActiveUsers,
  Contact,
  NonActiveUsers,
  NotFound,
  Category,
  Login,
  ActiveProducts,
  DisActiveProducts,
  MarketBaner,
  MarketCarousel,
  MarketCardCarousel,
  Width,
  Length,
  Material,
  Color,
} from "../pages/index";
import ScrollIntoView from "./ScrollIntoView";
import Loading from "../components/loading";
const PrivateRoute = lazy(() => import("./PrivateRoute"));

const App = () => {
  return (
    <BrowserRouter>
      <ScrollIntoView>
        <Suspense fallback={<Loading />}>
          <Switch>
            <PrivateRoute
              restricted={false}
              component={ActiveUsers}
              path="/orders"
              exact
            />
            <PrivateRoute
              restricted={false}
              component={ActiveUsers}
              path="/ActiveUsers"
              exact
            />
            <PrivateRoute
              restricted={false}
              component={NonActiveUsers}
              path="/DisActiveUsers"
              exact
            />

            <PrivateRoute
              restricted={false}
              component={Contact}
              path="/posts"
              exact
            />
            {/* <PrivateRoute
              restricted={false}
              component={ContactResponse}
              path="/sendPost"
              exact
            /> */}
            <PrivateRoute
              restricted={false}
              component={Contact}
              path="/notifications"
              exact
            />
            <PrivateRoute
              restricted={false}
              component={ActiveProducts}
              path="/ActiveProducts"
              exact
            />
            <PrivateRoute
              restricted={false}
              component={DisActiveProducts}
              path="/DisActiveProducts"
              exact
            />

            <PrivateRoute
              restricted={false}
              component={MarketBaner}
              path="/m-baner"
              exact
            />
            <PrivateRoute
              restricted={false}
              component={MarketCarousel}
              path="/m-carusel"
              exact
            />
            <PrivateRoute
              restricted={false}
              component={MarketCardCarousel}
              path="/card-carusel"
              exact
            />
            <PrivateRoute
              restricted={false}
              component={NonActiveUsers}
              path="/nonActiveUsers"
              exact
            />

            <PrivateRoute
              restricted={false}
              component={Category}
              path="/category"
              exact
            />

            <PrivateRoute
              restricted={false}
              component={Width}
              path="/Width"
              exact
            />

            <PrivateRoute
              restricted={false}
              component={Length}
              path="/length"
              exact
            />

            <PrivateRoute
              restricted={false}
              component={Material}
              path="/material"
              exact
            />

            <PrivateRoute
              restricted={false}
              component={Color}
              path="/color"
              exact
            />

            <Route component={Login} path="/login" exact />

            <Route path="/" component={Login} />
            <Route path="*" component={NotFound} />
          </Switch>
        </Suspense>
      </ScrollIntoView>
    </BrowserRouter>
  );
};

export default App;
